DROP TABLE IF EXISTS `a_test`;
CREATE TABLE `a_test`  (
  `id` bigint(20) NOT NULL DEFAULT 0 COMMENT '主键',
  `name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '工人姓名 ',
  `id_card_type` char(2) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '证件类型 参考数据字典：人员证件类型字典表',
  `id_card_number` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '证件号码 ',
  `gender` int(11) NULL DEFAULT NULL COMMENT '工人性别 参考数据字典：性别字典表',
  `nation` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '民族 身份证上民族信息，如：汉，回，藏等',
  `edu_level` int(11) NULL DEFAULT NULL COMMENT '学历 参考数据字典：学历类型字典表',
  `degree` int(11) NULL DEFAULT NULL COMMENT '学位 参考数据字典：学位类型字典表',
  `worker_type` int(11) NULL DEFAULT NULL COMMENT '类别 参考数据字典：人员类别字典表',
  `birthday` datetime(0) NULL DEFAULT NULL COMMENT ' 出生日期',
  `birth_place_code` char(6) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '籍贯 身份证号码前六位',
  `address` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '住址',
  `head_image_url` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '头像 二代身份证上面的头像，尺寸为358px*441px',
  `head_image_name` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '头像名称',
  `head_snap_url` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '拍抓头像路径',
  `head_snap_name` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '拍抓头像名称',
  `politics_type` char(2) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '政治面貌 参考数据字典：政治面貌字典表',
  `isJoined` tinyint(1) NULL DEFAULT NULL COMMENT '是否加入工会 参考数据字典：是否字典表',
  `joined_time` datetime(0) NULL DEFAULT NULL COMMENT '加入工会时间 已加入工会时，此字段必须有值',
  `cell_phone` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '话电',
  `culture_level_type` char(2) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '文化程度 参考数据字典：文化程度字典表',
  `specialty` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '特长 ',
  `has_bad_medical_history` tinyint(1) NULL DEFAULT NULL COMMENT '是否有重大病史',
  `urgent_link_man` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '紧急联系人姓名 ',
  `urgent_link_man_phone` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '紧急联系电话 ',
  `work_type_code` char(4) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '当前工种',
  `work_corp_name` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '当前聘用企业 ',
  `work_date` datetime(0) NULL DEFAULT NULL COMMENT '开始工作日期 精确到月,格式：yyyy-_m_m',
  `marital_status` char(2) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '婚姻状况 参考数据字典：婚姻状况字典表',
  `grant_org` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发证机关',
  `positive_id_card_image_url` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '正面照 url ',
  `negative_id_card_image_url` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '反面照 url ',
  `start_date` datetime(0) NULL DEFAULT NULL COMMENT '有效期开始日期 证件有效期开始日期',
  `expiry_date` datetime(0) NULL DEFAULT NULL COMMENT '有效期结束日期 证件有效期结束日期',
  `end_date` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '有效期结束日期 证件有效期永久',
  `orgid` int(11) NOT NULL COMMENT '所属组织id ',
  `create_orgid` int(11) NULL DEFAULT NULL COMMENT '所属包分机构',
  `tenant_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '租户ID ',
  `in_user_name` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人 ',
  `in_date` datetime(0) NULL DEFAULT NULL COMMENT '创建时间 ',
  `edit_user_name` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '编辑人 ',
  `edit_date` datetime(0) NULL DEFAULT NULL COMMENT '编辑时间 ',
  `in_user_id` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人id',
  `edit_user_id` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '编辑人id',
  `home_address` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '家庭住址 ',
  `record_no` bigint(20) NULL DEFAULT NULL COMMENT '闸机人员记录集ID',
  `project_id` bigint(20) NOT NULL COMMENT '项目ID',
  `project_code` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '项目编码 ',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

