  `SAFETYRISK_ID` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '主键',
  `SAFETYRISK_CREATEUSERNAME` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '创建数据的用户名称',
  `SAFETYRISK_CREATEUSERID` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '创建数据的用户id',
  `SAFETYRISK_CREATEDATE` datetime(0) NOT NULL COMMENT '创建数据的时间',
  `SAFETYRISK_OPERDATE` datetime(0) NOT NULL COMMENT '操作时间',
  `SAFETYRISK_OPERUSER` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '修改数据的用户名称',
  `SAFETYRISK_OPERUSERID` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '操作数据的用户id',
  `SAFETYRISK_PROJECTID` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '项目id',
  `SAFETYRISK_RISKPOINT` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '风险点',
  `SAFETYRISK_WORKCONTENT` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '作业内容或装置结构',
  `SAFETYRISK_RISKFACTORS` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '(危险源/危害因素)',
  `SAFETYRISK_LOCATION` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '所在位置',
  `SAFETYRISK_ESTIMATEDBEGIONTIME` datetime(0) NULL DEFAULT NULL COMMENT '预计开始时间',
  `SAFETYRISK_ESTIMATEDENDTIME` datetime(0) NULL DEFAULT NULL COMMENT '预计结束时间',
  `SAFETYRISK_Type` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '风险类型',
  `SAFETYRISK_STATE` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '风险状态',
  `SAFETYRISK_ACCIDETTYPE` varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '事故类型',
  `SAFETYRISK_REPONSIBLEUNIT` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '责任单位，默认当前单位',
  `SAFETYRISK_REPONSIBLEUNITID` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '责任单位id',
  `SAFETYRISK_REPONSIBLEPEOPLES` varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '责任人集合',
  `SAFETYRISK_RESPONSIBLEPEOPLEIDS` varchar(400) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '责任人id集合',
  `SAFETYRISK_ASSESSMENT` varchar(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '风险评价类型（0.经验判断法，1.专家调查法，2.作业条件危险分析法，3.风险矩阵分析法，默认保存当前评价类型）',
  `SAFETYRISK_L` float NULL DEFAULT NULL COMMENT '事故发生的可能性',
  `SAFETYRISK_E` float NULL DEFAULT NULL COMMENT '暴露于危险的频繁程度',
  `SAFETYRISK_C` float NULL DEFAULT NULL COMMENT '事故产生的后果',
  `SAFETYRISK_D` float NULL DEFAULT NULL COMMENT '（L*C*E）',
  `SAFETYRISK_SERIOUSNESS_S` int(11) NULL DEFAULT NULL COMMENT '风险阵距严重性s',
  `SAFETYRISK_POSSIBILITY_L` int(11) NULL DEFAULT NULL COMMENT '风险阵距可能性L',
  `SAFETYRISK_ARRAYDISTANCE_R` int(11) NULL DEFAULT NULL COMMENT '风险针距r（s*l=R）',
  `SAFETYRISK_SOURCELEVEL` varchar(4) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '风险级别',
  `SAFETYRISK_ENGINEERINGMEASURES` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '工程技术措施',
  `SAFETYRISK_CONTROLMEASURE` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '管理措施',
  `SAFETYRISK_EDUCATIONMEASURES` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '教育培训措施',
  `SAFETYRISK_PERSONALMEASURES` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '个体防护',
  `SAFETYRISK_EMERGENCYMEASURES` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '应急处理措施',
  `SAFETYRISK_SAVESTATE` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '保存状态，0保存，1提交',
  PRIMARY KEY (`SAFETYRISK_ID`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

